import { Container } from "react-bootstrap";
import ProductCard from "../cards/ProductCard";

let props = [
    {
        title:"Portrait only (without frame)",
        price:"400",
        url:"/order"
    },
    {
        title:"Portrait with frame",
        price:"800",
        url:'/order'
    }
];
const Pricing = () => {
    return(
        <Container className='customContainer'>
            <ProductCard className='mg-tb' {...props[0]}></ProductCard>
            <ProductCard className='mg-tb' {...props[1]}></ProductCard>
        </Container>

    );
}

export default Pricing
